import express from 'express';
const fs = require('fs');
const path = require('path');
const app = express();
// const router = express.Router();

app.get('/code/:code', (req, res) => {
  try {
    console.log('code got to');
    console.log(req.params);
    const data = fs.readFileSync(path.join(__dirname, './languages.json'));
    const stats = JSON.parse(data);
    console.log('params reQEYS');
    console.log(req.params);
    const playerStats = stats.find((player) => player.code === req.params.code);
    if (!playerStats) {
      const err = new Error('Player stats not found');
      err.status = 404;
      throw err;
    }
    return res.json(playerStats);
  } catch (e) {
    console.log('error FOUND');
    console.log(e);
  }
});
// router.route('/code/:code').get(getStats);
app.get('/', (req, res) => {
  console.log('yay!');
  console.log(req.params);
  return res.send('Received a GET HTTP method');
  // const getLanguage = async (req, res, next) => {
  try {
    const data = fs.readFileSync(path.join(__dirname, './languages.json'));
    const languageCodes = JSON.parse(data);
    console.log('Response: ', req.params.id);
    const language = languageCodes.find((languages) => languages.code === Number(req.params.id));
    if (!language) {
      const err = new Error(`Language code for ${req.params.id} not found`);
      err.status = 404;
      throw err;
    }
    return res.json(language);
  } catch (e) {
    console.log('error', e);
  }
  // };
});

app.post('/', (req, res) => {
  return res.send('Received a POST HTTP method');
});

app.put('/', (req, res) => {
  return res.send('Received a PUT HTTP method');
});

app.delete('/', (req, res) => {
  return res.send('Received a DELETE HTTP method');
});

app.listen(3000, () => console.log(`Example app listening on port ${3000}!`));
